import styled from "styled-components/native";
import { css } from "styled-components/native";
import { View } from "react-native";

const sizeVariant = {
  small: 1,
  medium: 2,
  large: 3,
};
const positionVariant = {
  top: "marginTop",
  left: "margin-left",
  right: "marginRight",
  bottom: "marginBottom",
};

export const Spacer = styled.View`
  ${(props) => {
    console.log(
      "data",
      props.$size,
      props.$position,
      positionVariant[props.$position]
    );
    return css`
      ${positionVariant[props.$position]}:${props.theme.sizes[
        sizeVariant[props.$size]
      ]}
    `;
  }}
`;
